let scroll = { x: 0 };
const step = 10;
const rectWidth = canvas.width / 100;
context.globalCompositeOperation = "multiply";

document.addEventListener("scroll", (e) => {
  gsap.to(scroll, 0.5, {
    x: -window.scrollY / 2,
  });
});

let lastScroll = { x: null };
const animate = () => {
  requestAnimationFrame(animate);

  if (window.pageYOffset > startOffset + rect.bottom + 300) {
    return;
  }

  if (lastScroll.x === scroll.x) {
    return;
  }

  lastScroll = { ...scroll };

  context.clearRect(0, 0, canvas.width, canvas.height);

  context.fillStyle = config.yellow.color;
  context.beginPath();
  for (let x = 0; x < canvas.width; x += rectWidth) {
    context.moveTo(x + rectWidth / 2, 0);
    context.lineTo(x + rectWidth, canvas.height);
    context.lineTo(x, canvas.height);
  }
  context.closePath();
  context.fill();
  context.save();
  context.translate(scroll.x, 0);
  context.clip(path);

  context.fillStyle = config.magenta.color;
  for (let x = 0; x < canvas.width; x += step) {
    for (let y = 0; y < canvas.height; y += canvas.height / 7) {
      context.fillRect(
        x - scroll.x - (rectWidth * config.magenta.scale) / 2,
        y,
        rectWidth * config.magenta.scale,
        canvas.height / 7 - step / 7
      );
    }
  }
  context.restore();

  context.save();
  context.translate(scroll.x + 1, 1);
  context.clip(path);
  context.fillStyle = config.cyan.color;
  for (let x = 0; x < canvas.width; x += step) {
    context.fillRect(
      x - scroll.x - (rectWidth * config.cyan.scale) / 2,
      0,
      rectWidth * config.cyan.scale,
      canvas.height
    );
  }
  context.restore();
};

animate();
